ウィンドウ周りがシャープなルックスに早変わり！<br>
ステンレスSUS304（厚さ0.6ｍｍ）を使用した贅沢な光沢をお楽しみ下さい。<br>
日本製ですのでクオリティーは抜群！ 取付は両面テープで貼るだけなので超カンタンです。<br>
<br> 
※取付用両面テープはついておりませんのでお客様にてご用意下さい。 <br>
※取付は必ず民間車検工場や認定工場で行って下さい。 <br>
※写真はサンプル画像なので実際の商品とは異なります。ご注意下さい。<br>■適合車種<br>
ekスポーツ H82W (2006年9月以降)<br>
<br>
